import React, { useEffect, useState, useRef } from "react";
import { withRouter } from "react-router-dom";
import Box from "@material-ui/core/Box";
import Card from "@material-ui/core/Card";
import { Form, FormGroup } from "reactstrap";
import TextField from "@material-ui/core/TextField";
import { toast } from "react-toastify";
import "date-fns";
import "@rmwc/typography/styles";
import "react-toastify/dist/ReactToastify.css";

import MultAxis from '../MultAxis';
import axios from "axios";


var array = [];
//4997680000	4806250000	191427000	2020-11-30 00:00:00

const fetchData = () => {
    return fetch("https://randomuser.me/api/")
          .then((response) => response.json())
          .then((data) => console.log(data));}




const Grafica = ({history}) => {

    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);
  
    // Note: the empty deps array [] means
    // this useEffect will run once
    // similar to componentDidMount()
    useEffect(() => {
      fetch("https://randomuser.me/api/")
        .then(res => res.json())
        .then(
          (result) => {
            setIsLoaded(true);
            setItems(result);
          },
          // Nota: es importante manejar errores aquí y no en 
          // un bloque catch() para que no interceptemos errores
          // de errores reales en los componentes.
          (error) => {
            setIsLoaded(true);
            setError(error);
          }
        )
    }, [])

    return(
        <>
        {console.log('aquiiii'),console.log(items),console.log('finn')}
        <center>
            <label>Grafica Ranking de Bancos AQUI</label>
            
        </center>
        datos
        {
        }
        <MultAxis arreglo = {array} />

        </>
    );
}

export default withRouter(Grafica);
